import React from 'react';
import Block1 from './block1';
import Block2 from './block2';
import Block3 from './block3';
import Block4 from './block4';

export default class Page extends React.Component{


    render(){
const restyle ={
    display: "inline-block",
    width: "50px",
    position: "relative",
    textAlign: ""
}

      return(
          <div style={restyle}>
        <Block1 />
        <Block2 />
        <Block3 />
        <Block4 />
          </div>
      );


    }


}
